import './App.css'
import LoginPage from './LoginPage';
import FireStationPage from './FireStationPage';
import MainStatusPage from './MainStatusPage';
import RegisterPage from './RegisterPage';
import { Route, Link } from "react-router-dom"


function App() {
  return (
    <div className="App">
      <Route exact path="/" component={LoginPage} />
      <Route exact path="/RegisterPage" component={RegisterPage} />
      <Route exact to="/MainStatusPage" component={MainStatusPage} />
      <Route exact to="/FireStationPage" component={FireStationPage} />
    </div>
  );
}

export default App;
